const Projects = () => {
  return (
    <>
      <div className='d-flex justify-content-center align-items-center min-vh-100'>
        <Card title='Breaking Bingo' />
        <Card title='Impressentation' />
        <Card title='Der Markt' />
      </div>
    </>
  );
};

export default Projects;
